windows_config_yaml:
package:
  - path: {{ windows_dcos_install_path }}\etc\check_time.env
    content: |
        ENABLE_CHECK_TIME=true
  - path: {{ windows_dcos_install_path }}\etc\zk_agent_credentials
    content: |
       {{ zk_agent_credentials }}
  - path: {{ windows_dcos_install_path }}\etc\adminrouter\adminrouter-listen-ee.conf
    content: |
      listen 61002 ssl default_server;
{% switch adminrouter_agent_enforce_https %}
{% case "all" %}
      # Not serving HTTP as of adminrouter_agent_enforce_https == "all"
{% case "none" %}
      listen 61001 default_server;
{% endswitch %}
  - path: {{ windows_dcos_install_path }}\etc\adminrouter\adminrouter-upstreams-ee.conf
    content: |
      proxy_ssl_trusted_certificate {{ windows_dcos_var_path }}/run/pki/CA/ca-bundle.crt;
      proxy_ssl_verify on;
      proxy_ssl_verify_depth 5;
      set $upstream_iam https://master.mesos;
  - path: {{ windows_dcos_install_path }}\etc\adminrouter\adminrouter-tls-agent.conf
    content: |
      ssl_ciphers EECDH+AES128:RSA+AES128:EECDH+AES256:RSA+AES256:!MD5;
      ssl_prefer_server_ciphers on;
      ssl_protocols TLSv1.2;
